import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "./TopRated.css";
import { Pagination } from "swiper/modules";

const TopRated = () => {
  return (
    <>
      <Swiper
        slidesPerView={4}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src="/images/loki.jfif"></img>
        </SwiperSlide>
      </Swiper>
    </>
  );
};
export default TopRated;
